import { Box, BoxItem, List, ListItem, Typography, Link} from '@material-ui/core';
import { makeStyles } from '@material-ui/styles';
import { RSS_logo } from '/home/fredrikfischer/Documents/Programmering/React projects/min-hemsida-1/src/images/RSS_logo.png'


const Contact = () => {

    const useStyles = makeStyles({
        thisList: {
            padding: "0",
            margin: "0"
        },
        mainDiv: {
            margin: "40px"
        }
      })
      
      const classes = useStyles();
    return (
    <div className={classes.mainDiv}>
        <h2>Kontaktuppgifter</h2>
            <List className={classes.thisList}>
                <ListItem >
                Mail: fredrik.fischer@protonmail.com
                </ListItem>
                <ListItem>
                <img src="RSS_logo.png"/> <Typography>RSS:   <Link href="https://fredrikfischer.se/RSS.xml" underline="none">fredrikfischer.se/RSS.xml</Link></Typography>  
                </ListItem>
                <ListItem>
                <Typography>Github: <Link href="https://github.com/fredrikfischer" underline="none">github.com/fredrikfischer</Link></Typography>
                </ListItem>
            </List>
    </div>
    )
    
}

export {Contact}
